import React from 'react';
import '../App.css';
import { TypeAnimation } from 'react-type-animation';


const About = () => {
  return (
    <div className="image-overlay-container">
      <img className="image" src="https://images.unsplash.com/photo-1682321412276-a1ebbb48d67f?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1171&q=80 1171w" alt="Logo" />
      <div className="overlay"></div>
      <div className="text-container">
        <h1>About Me</h1>
        <p>Hi, my name is Anurudran and I'm a recent graduate from University Toronto Scarborough.</p>
        <p>I have experience working with React, Node.js, and other web technologies.</p>
        <p>In my free time, I enjoy playing sports, working out, and hanging out with friends.</p>
      </div>
    </div>
  );
};


export default About;
